B.Bb=new A.aD("Virtual display","Performance improvements","The virtual display is now hardware accelerated via the V4L2 API. As a result, this solution behaves consistently regardless of CPU usage (gaming, video playback).\n\nThe capture mechanism has also been replaced. The new solution sends data to the browser less frequently if nothing is happening on the display. As a result, overall resource usage of the front end is significantly reduced in typical use.\n\nInternally the refresh rate of the headless operation mode in drm_hwcomposer is now capped at 30Hz. The SufraceFlinger is not able to provide more frames to the virtual display(buffer allocation related).\n\nSystem animation duration is now reduced to improve performance.\n\nVirtual display window scaling has been modified to slightly increase text size in system apps; it makes them more easily readable when driving.")
B.A7=new A.aD("Browser audio","Usability improvements","Version 2023.18.1 adds the ability to control the sound settings in the Flutter app. The feature can be disabled if you intend to use Bluetooth Audio or other peripherals.")
B.B1=new A.aD("Virtual touchscreen","Multitouch support","Multitouch support is now available in Tesla Android. The overall stability of the component has been increased.")
B.Ae=new A.aD("Android Platform","Boot time optimization","Version 2023.18.1 takes ~2/3x less time to boot when compared to other Android 13 releases.")
B.Av=new A.aD("Android Platform","Support for OTA updates","Version 2023.18.1 adds support for OTA updates. A/B (Seamless) mechanism ensures a safe installation with a rollback to the previous build in case of failure. The process takes place in the background; you can use Tesla Android when the update is being installed.\n\nNavigate to Settings -> System -> Updater to check update availability in the future.\n\nUpdates are not incremental. You can skip a few versions and update directly to the newest build.\n\nOnly online updates are available in this release; connect your Raspberry Pi to your home router with an Ethernet cable to avoid data charges. Each update weighs around 1 GB.")
B.AO=new A.aD("Single image install","Usability improvements","The bootloader has been updated to support the single-image install process better. In addition, the filesystem will now expand to take advantage of the entire SD Card on the first boot(similar to how Raspbian behaves).\n\nAny SD Card over 16GB will work with Tesla Android, but 64GB is recommended.\n\nThe download size has been significantly reduced, and the manual installation procedure has been deprecated and removed from the website. ")
B.Az=new A.aD("Bluetooth","Usability improvements","Version 2023.18.1 fixes problems with Bluetooth Low Energy. You can now use wireless game controllers, OBD interfaces, and more. Bluetooth Audio stability is also improved.")
B.Ao=new A.aD("Android Platform","Stability improvements","Android has been updated to Android 13 release 41 with the latest security patches. The platform is now in sync with the latest GloDroidCommunity AOSP base. All the board-related changes have been sent upstream, and Tesla Android was migrated to a new build mechanism to make future Android platform updates faster.")
B.Ac=new A.aD("Flutter App","Usability improvements","The has been reorganized to make room for new modules. Tapping the version ribbon takes you to the screen with multiple tabs. One of them is the new Settings module, where you can control the browser audio.")
B.AU=new A.aD("Video playback","Performance improvements","Version 2023.18.1 adds AV1 decoding via ffmpeg_codec2. The new component takes advantage of multiple cores and performs better.")
B.Aq=new A.aD("Connectivity","Usability improvements","Version 2023.18.1 adds support for Huawei(Brovi) E3372-325. The device is available in the European market.")
B.AX=new A.aD("Compute Module 4","Hardware improvements","Version 2023.18.1 adds support for the Raspberry Pi Compute Module 4 and was tested with both EMMC(32GB) and SD Card-equipped variants. The external Wi-Fi antenna is selected by default.")
B.B8=new A.aD("PWM fan support","Hardware improvements","PWM is now enabled on GPIO 18. Supported coolers will only turn on if necessary. You can change the settings in config.txt on the boot partition of the SDCard.")
B.GB=A.a(s([B.Bb,B.A7,B.B1,B.Ae,B.Av,B.AO,B.Az,B.Ao,B.Ac,B.AU,B.Aq,B.AX,B.B8]),t.d)
B.Ui=new A.fL("2023.18.1",B.GB)
B.AC=new A.aD("Android Platform","Stability improvements","Android has been updated to Android 13.0.0_r31 with the latest available security patches.")
B.AM=new A.aD("H264 hardware acceleration","Stability improvements","Version 2023.7.1 improves the stability of the playback and solves issues with artifacts present in the previous version.")
B.As=new A.aD("H265 hardware acceleration","Usability improvements","This version adds support for hardware-accelerated H265 video playback via ffmpeg_codec2.")
B.B2=new A.aD("Software audio decoders","Usability improvements","2023.7.1 adds software audio decoders exposed by ffmpeg_codec2 for the following file formats: \n\u2022 aac  \n\u2022 ac3  \n\u2022 alac  \n\u2022 flac  \n\u2022 mp2  \n\u2022 mp3  \n\u2022 vorbis  \n\nMost of the formats were previously supported by software decoders included with Android. The ffmpeg-powered replacements tend to consume fewer CPU resources.")
B.AK=new A.aD("Software video decoders","Usability improvements","2023.7.1 adds software video decoders exposed by ffmpeg_codec2 for the following file formats: \n\u2022 h263  \n\u2022 mpeg2  \n\u2022 mpeg4  \n\u2022 vp8  \n\u2022 vp9  \n\nMost of the formats were previously supported by software decoders included with Android. The ffmpeg-powered replacements tend to consume fewer CPU resources.")
B.A9=new A.aD("Flutter App","Stability improvements","Flutter App received various improvements in this update: \n\u2022 The framework has been updated to version 3.7. \n\u2022 Version ribbon has been repositioned to the upper right corner. \n\u2022 Reverted changes in touchscreen transport that were introduced in 2023.4.1. The previous implementation was more stable.\n\u2022 The reliability of the connectivity checker module was improved by removing the ability to cache static HTML content in Lighttpd. The browser used to cache the health check response for a while after Tesla Android services became unavailable.")
B.AP=new A.aD("Audio playback","Stability improvements","This version increases the audio playback buffer flush interval from 30 to 100 milliseconds with the hope of decreasing stuttering in cases where the MCU is not able to process the data from WebSocket transport in time.")
B.Jq=A.a(s([B.AC,B.AM,B.As,B.B2,B.AK,B.A9,B.AP]),t.d)
B.Uo=new A.fL("2023.7.1",B.Jq)
B.AQ=new A.aD("Virtual display","Performance improvements","Version 2023.4.1 introduced a new transport layer to the virtual display. Unfortunately, it misbehaved in vehicles with Intel MCU, especially those with the Wi-Fi antenna placed outside the car. This version brings back the transport from 2022.45 and keeps other improvements like the connectivity check module.")
B.AJ=new A.aD("Audio playback","Usability improvements","The previous update introduced volume control in Android. However, default values were around 50%, confusing users. 2022.4.2 resolves this issue and sets the Android system volume to 100%.")
B.B7=new A.aD("Flutter App","Performance improvements","Version 2023.4.2 brings several improvements in performance to the Flutter app: \n\u2022 Removed fade-in and fade-out transitions from the audio playback component on each buffer flush. This change makes the volume curve consistent.\n\u2022 After introducing a workaround for offline PWA support, the rendering engine was changed from HTML to CanvasKit.\n\u2022 Reduced the amount of ping/pong frames used by the WebSocket transport for the virtual touchscreen")
B.Fi=A.a(s([B.AQ,B.AJ,B.B7]),t.d)
B.Uk=new A.fL("2023.4.2",B.Fi)
B.AD=new A.aD("Android 13","Stability improvements","The Android version has been updated to 13, and this change improves the stability of Tesla Android. Security patches have also been merged up to October 2022. The Android base for Raspberry Pi used by Tesla Android(Glodroid Project) has also been updated to the newest release, and it comes packed with improvements around the kernel, display drivers, and much more.\n\nThe entire Tesla Android codebase has been refactored in order to make feature Android Platform updates easier; this is an essential step towards making the project more maintainable.")
B.Aw=new A.aD("H264 hardware acceleration","Performance improvements","Version 2022.4.1 adds support for hardware accelerated encoder and decoder for the H264 format. Playback of specific files can contain a small number of artifacts. This is a known issue that will be addressed in the future Tesla Android update. The current implementation of hardware acceleration is based on v4l2_codec2 and will be replaced with an alternative that supports more video formats.")
B.AG=new A.aD("Virtual display","Stability improvements","The virtual display has been updated to use WebSockets for transport.")
B.Ay=new A.aD("Virtual touchscreen","Stability improvements","This version contains a fix for a problem with not being able to process input data after reloading the Flutter App.")
B.AF=new A.aD("Audio playback","Stability improvements","The Audio Capture app that used to provide audio from Android to the Browser has been replaced with a new low-level implementation that integrates directly with the Android framework responsible for generating the audio stream before it\u2019s broadcasted to the actual hardware(HDMI, headphone jack, etc.). This new approach brings in a lot of other improvements:\n\u2022 Increased audio quality (stereo PCM 48kHz - Lossless Audio)\n\u2022 Support for DRM content (streaming services)\n\u2022 Support for volume control in Android (available in the Android Settings app)")
B.B9=new A.aD("Flutter app","Stability improvements","The Flutter App has been refactored to improve stability. Here are some of the changes:\n\u2022 WebSockets handling for Tesla Android services has been improved.\n\u2022 Thanks to the new transport layer, the Virtual Display component is now powered by Flutter. This significantly improves stability when compared to the previously used Iframe-based approach.\n\u2022 The connectivity state observer component has been introduced. The app will notify you when it wouldn\u2019t be able to access Tesla Android services. This change ensures you will not have to manually reload the app when your car returns from sleep or the hardware itself restarts.\n\u2022 Flutter Framework has been updated to version 3.3.10")
B.AH=new A.aD("USB tethering for iOS","Connectivity improvements","Version 2023.4.1 adds support for sharing the internet from iOS devices via USB. Connect your phone, enable tethering and accept the USB access permission request on your iPhone.")
B.AZ=new A.aD("LTE Modem support","Connectivity improvements","This update introduces a new Android system service. The Tesla Android USB Networking Initializer simplifies how USB Modems are initialized and allows the use of per-device configuration scripts. This change resolved issues with some variants of Alcatel devices and added support for more Huawei modems.")
B.GI=A.a(s([B.AD,B.Aw,B.AG,B.Ay,B.AF,B.B9,B.AH,B.AZ]),t.d)
B.Uf=new A.fL("2023.4.1",B.GI)
B.B5=new A.aD("Google Apps","Usability improvements","Version 2022.45.1 brings back Google Play Store and other Google Services that were removed in 2022.25.1. Device ID registration for Google Play is not longer required. Not all apps can be installed using Google Play Store due to lack of device certification, they need to be installed manually.")
B.AT=new A.aD("Android Platform","Stability improvements","Tesla Android system services initialisation has been improved, all components(web server, touchscreen, display etc.) will automatically restart on failure. In previous versions a full system reboot would be needed in this scenario.")
B.Ak=new A.aD("Virtual display","DRM playback","Version 2022.45.1 fixes DRM video playback and enables access to secure layers that are usually blacked out in screen capture.")
B.Am=new A.aD("CarPlay","Visual improvements","Three row layout for CarPlay is now selected as default.")
B.Ah=new A.aD("Virtual touchscreen","Stability improvements","Flutter app no longer displays information about virtual touchscreen initialisation, it is irrelevant for the single board stack and should have been removed earlier.")
B.AW=new A.aD("Bluetooth","Stability improvements","Restarting the system after disabling Bluetooth is no longer required.")
B.A8=new A.aD("Internet access","USB tethering for Android","USB tethering from Android phones is now supported in Tesla Android. No configuration is required to enable this feature. Your Android phone will be detected as an external ethernet interface when you enable tethering.")
B.B0=new A.aD("Internet access","LTE modem support","2022.45.1 introduces support for USB network devices using the cdc_ncm driver - it has been validated and works without any additional steps from the user. Experimental changes that might enable support for cdc_mbim and rndis_host drivers are also included. Previous versions supported only the cdc_ether driver.")
B.A6=new A.aD("Internet access","Support for external routers","Tesla Android webserver and other services can now be accessed externally using ethernet. This can be used to access the device in your home network or in the car with an external router.")
